import "./footer.css";
import { Link, useNavigate } from "react-router-dom";
import FacebookIcon from '@mui/icons-material/Facebook';
import EmailIcon from '@mui/icons-material/Email';
import WebIcon from '@mui/icons-material/Web';
const Footer = () => {
    return (
        <main className="footer-container">
            <div className="footer-content">
                <div className="footer-info-box">
                    <h1>Logo</h1>
                    <div className="icon-box">
                        <FacebookIcon />
                        <EmailIcon />
                        <WebIcon />
                    </div>
                    <div>
                        <h1>CÔNG TY CỔ PHẦN EVENTIUH</h1>
                        <p>12 Nguyễn Văn Bảo, Phường 3, Gò Vấp, Hồ Chí Minh</p>
                        <p>https://iuh.edu.vn/</p>
                        <p>09712312322</p>
                    </div>
                </div>
                <div className="orther-info">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/b/bf/Logo_IUH.png" style={{ width: "300px", height: "auto" }}></img>
                </div>
            </div>
        </main>
    );
};

export default Footer;
